import './App.css';
import React from 'react';
import { Button, TextField, Icon, Container } from '@material-ui/core';

function RowNameDate() {
  return (
    <div className="rowDateFrag">
      <label>Name</label>
      <TextField className="inputName" id="outlined-basic" label="Outlined" variant="outlined" />


      <label>Date</label>
      <TextField
        className="inputDate"
        id="date"
        label="Birthday"
        type="date"
        defaultValue="2017-05-24"
        InputLabelProps={{
          shrink: true,
        }}
      />
    </div>
  );
}

function SendBtn() {
  <div className="sendBtn">
    <Button
      variant="contained"
      color="primary"
      endIcon={<Icon>send</Icon>}
    >
      Send
    </Button>
  </div>
}

function RowContext() {
  return (
    <div>
      <label>Context</label>
      <TextField className="inputContext" id="outlined-basic" label="Outlined" variant="outlined" fullWidth="true" multiline />
    </div>
  );
}

function App() {

  return (
    <Container>
      <form className="InputForm">
        <RowNameDate />
        <RowContext />
      </form>
      <SendBtn />
    </Container>
  );
}

export default App;
